import React from 'react';
import { BsFillPersonLinesFill } from "react-icons/bs";
import styled from "styled-components";
import { darken, lighten } from 'polished';



export const MyPageTitle = styled.div`
  margin-top: 1vh;
  color : #323232;
  font-family: Nanum Barun Gothic;
  font-size : 1.5vh;
  font-weight: bold;
  &:hover {                
    color: ${lighten(0.5, '#228be6')};
  }
`;

export const ProfileIcon = styled.img`
  color : #323232;
  width: 18%;
  height: 40%;
  &:hover {                
    color: ${lighten(0.1, '#228be6')};
  }
`;

export const NavMyPageContainer = styled.div`
  display: inline;
    height: 50%;
    width: 10%;
    &:hover {                
    color: ${lighten(0.1, 'red')};
  }
`;

const NavMyPage = () => {
  return (
    <NavMyPageContainer>
      {/* <BsFillPersonLinesFill size="24" color='grey' /> */}
      <ProfileIcon src="icons/mypage.png" />
      <MyPageTitle>내 정보</MyPageTitle>
    </NavMyPageContainer>
  );
};

export default NavMyPage;
